import "./NavHome.js";
import { AiOutlineHome } from "react-icons/ai";
const NavHome = () => {
  return (
    <div>
      <a className="navhome" href="google.com">
        <AiOutlineHome/>
      </a>
    </div>
  );
};

export default NavHome;
